import React, { useEffect } from 'react'
import { useDispatch, useSelector } from 'react-redux'
import { dashboardManager } from '../redux/slices/managerSlices'
import { Table, Row, Col, Tooltip, User, Text ,Button} from "@nextui-org/react";
import Moment from 'react-moment';
import { Link, Navigate } from "react-router-dom";
// import { EditIcon } from "./Icon/EditIcon";
// import { DeleteIcon } from "./Icon/DeleteIcon";
const Home = () => {
    const dispatch=useDispatch();
    useEffect(()=>{
        dispatch(dashboardManager());
        },[dispatch]);

const emplyeedata=useSelector((state)=>state?.users?.dashboardData);
const {employees}=emplyeedata;
console.log(employees);

  
  return (
    <div>
 <Table
      aria-label="Example table with static content"
      css={{
        height: "auto",
        minWidth: "100%",
      }}
    >
      <Table.Header>
        <Table.Column>NAME</Table.Column>
        <Table.Column></Table.Column>
        <Table.Column>City</Table.Column>
      </Table.Header>
      <Table.Body>
     { employees?.map(employee=>{return (
          <Table.Row>
          <Table.Cell><User
              bordered
              as="button"
              size="lg"
              color="primary"
              name={employee?.firstName + employee?.firstName}
              description={employee?.email}
              src={'https://thumbs.dreamstime.com/b/black-solid-icon-employee-applicant-man-logo-symbol-146530494.jpg'}
            /></Table.Cell>
          <Table.Cell>{employee?.mobile}</Table.Cell>
          <Table.Cell>{<Moment format="YYYY/MM/DD">{employee?.createdAt}</Moment>}</Table.Cell>
          <Table.Cell>  
          <Button>edit</Button>
        </Table.Cell>
       
        </Table.Row>)
        })}
      </Table.Body>
    </Table>
    </div>
  )
}

export default Home
